import React, { useState } from 'react';
import "./index.css"

const HRLoginForm = () => {
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    // Logic to handle HR login
  };

  return (
    <div className='background d-flex flex-column justify-content-center align-items-center ' >
    <form onSubmit={handleSubmit} className='col-8  col-md-3 shadow d-flex flex-column form'>
      <div className="form-group m-1">
        <label htmlFor="hrEmail">USERNAME</label>
        <input
          type="username"
          className="form-control"
          id="hrEmail"
          value={username}
          onChange={(e) => setUsername(e.target.value)}
          required
        />
      </div>
      <div className="form-group m-1 ">
        <label htmlFor="hrPassword">PASSWORD</label>
        <input
          type="password"
          className="form-control"
          id="hrPassword"
          value={password}
          onChange={(e) => setPassword(e.target.value)}
          required
        />
      </div>
      <button type="submit" className="btn btn-primary hr-button m-1 align-self-center">Login</button>
    </form>
    </div>
  );
};

export default HRLoginForm;
